import React from 'react';
import ReactDOM from 'react-dom';
import AllRoad from "./AllRoad";
import roadGenerator from "./RoadGenerator";

let RoadArray = roadGenerator;
ReactDOM.render(
    <React.StrictMode>
        <AllRoad Road={RoadArray} />
    </React.StrictMode>,
    document.getElementById('root')
);
